// import React, {Component} from 'react'
import "./Style.css"

function Setcontent(props) {
    return (
        <div>
        <img id="thumbnail"src={props.thumbnail}/>
        <div id="title">{props.title}</div>
        <p>{props.authors}</p>
        <p>{props.publisher}</p>
        <p>{props.contents}</p>
        <p>{props.price}</p>
        <p>{props.status}</p>
        </div>
    )
}



export default Setcontent;
